import React, { Component } from 'react';
import questionData from "../data/questionsData";

class QuestionDetail extends Component {
    render() {
        return (
            <div>
                Question Detail Componenet 
                {this.props.questionId}
            </div>
        );
    }
}

export default QuestionDetail;
